                        alt="Task Image" src="true"></div>
                <div class="task-name" id="taskDetailsName"></div>
                <div class="task-description" id="taskDetailsDescription"></div>
                <div class="task-description2" id="taskDetailsDescription2"></div>
                <div class="task-reward"><img src="./assets/coin_icon.png" alt="Reward">
                    <span1 id="taskDetailsReward"></span1>
