        <script>
            var img_url1 = "./assets/damage_icon.svg";
            var img_url2 = "./assets/energy_icon_boost.svg";
            document.querySelector('.close-button').addEventListener('click', () => {
                document.getElementById('taskDetails').classList.remove('active');
                document.getElementById('overlay').classList.remove('active');
            });
            document.querySelectorAll('.boost-item[class="boost-item "]').forEach((button, index) => {
                button.addEventListener('click', () => {
                    document.getElementById('taskDetails').classList.add('active');
                    document.getElementById('overlay').classList.add('active');
                    var imgElement = document.getElementById('taskDetailsImage');
                    var taskName = document.getElementById('taskDetailsName');
                    var taskDescription = document.getElementById('taskDetailsDescription');
                    var taskDescription2 = document.getElementById('taskDetailsDescription2');
                    var taskReward = document.getElementById('taskDetailsReward');
                    var taskReward2 = document.getElementById('taskDetailsReward2');
                    if (index === 0) {
                        imgElement.src = img_url1;
                        taskName.textContent  = "Damage Boost"
                        taskDescription.textContent  = "Boost your damage"
                        taskDescription2.textContent  = "Increase damage by 1"
                        taskReward.textContent  = "2000"
                        taskReward2.textContent  = "1 LVL"
                    } else if (index === 1) {
                        imgElement.src = img_url2;
                        taskName.textContent  = "Energy Boost"
                        taskName.taskDescription.textContent  = "Boost your energy"
                        taskName.taskDescription2.textContent  = "Increase limit by 500"
                        taskName.taskReward.textContent  = "2000"
                        taskName.taskReward2.textContent  = "1 LVL"
                    }
                });
            });
        </script>
